input = ""


def react(data):
    old_len = 0
    while len(data) != old_len:
        old_len = len(data)
        i = 0
        while i < len(data) - 1:
            if abs(ord(data[i]) - ord(data[i + 1])) == 32:
                data = data[:i] + data[i + 2:]
                i -= 1
            i += 1
            # print("i:", i)
        # print("So far:", len(data))
    return len(data)


print("Part 1:", react(input))

min_len = 9999999999
for c in [chr(i) for i in list(range(ord('a'), ord('z') + 1))]:
    str = input.replace(c, "").replace(chr(ord(c) - 32), "")
    strlen = react(str)

    print(c, strlen)

    if strlen < min_len:
        min_len = strlen

print("Part 2:", min_len)
